import './list.css';
import Card from './Card';
import Item from './Item';

export default function List(props) {

    return (
        <Card>
            <List>
                {props.users.map((e) => { return <Item key={e.id} name={e.name} age={e.age} /> })}
            </List>
        </Card>
    )
}
